import React from 'react';
import uuidv1 from 'uuid/v1';
import { connect } from 'react-redux';
import { Card } from 'react-bootstrap';
import Task from '../Task/task';
import { setDoingTasks } from '../../actions/tasks';


class DoingList extends React.PureComponent {
  render() {
    
    return (
      <Card className="DoingList_card" style={{ marginLeft: '330px' }}>
        <Card.Body>
          <Card.Text> Doing </Card.Text>
          {
          this.props.doingTasks.filter(t => !(t.completed || t.deleted)).map(t => (<Task key={t.id} {...t} ></Task>))
          }
        </Card.Body>
      </Card>
    )
  }
}

const mapStateToProps = state => ({
  doingTasks: state.doingTasks,
});


const mapDispatchToProps = dispatch => ({
  setData: doingTasks => dispatch(setDoingTasks(doingTasks)),
});


export default connect(mapStateToProps, mapDispatchToProps)(DoingList);
